// accessory for touch sensing TODO
void my_disp_flush(lv_display_t *display, const lv_area_t *area, unsigned char *data)
{
  uint32_t w = lv_area_get_width(area);
  uint32_t h = lv_area_get_height(area);
  lv_draw_sw_rgb565_swap(data, w * h);
  if (lcd.getStartCount() == 0) {
    lcd.endWrite();
  }
  lcd.pushImageDMA(area->x1, area->y1, area->x2 - area->x1 + 1, area->y2 - area->y1 + 1, (uint16_t *)data);
  lv_disp_flush_ready(display);
}

void buzzerTone(uint16_t pinNum, uint16_t duration) {
  digitalWrite(pinNum, HIGH);
  delay(duration);
  digitalWrite(pinNum, LOW);
}

//power management along with ESP sleep, works with battery. not while on power via usb-c
void batteryInit(void) {
  pinMode(M5DIAL_POWER_HOLD_PIN, OUTPUT);
  digitalWrite(M5DIAL_POWER_HOLD_PIN, HIGH);
}

void batteryPowerDown(void) {
  digitalWrite(M5DIAL_POWER_HOLD_PIN, LOW);
}
