void lcdSetup(void) {
  //init lgfx lcd
  lcd.init();
  lcd.initDMA();
  lcd.startWrite();
  // Set rotation (0-3)
  lcd.setRotation(1);
  lcd.setBrightness(200);
  lcd.setColorDepth(LV_COLOR_DEPTH);
  lcd.fillScreen(TFT_BLACK);

  lv_init();

  lvDisplay = lv_display_create(LCD_WIDTH, LCD_HEIGHT); //TODO null check??
  lv_display_set_color_format(lvDisplay, LV_COLOR_FORMAT_RGB565);
  lv_display_set_flush_cb(lvDisplay, my_disp_flush);
  lv_display_set_buffers(lvDisplay, draw_buf1, draw_buf2, ((LCD_WIDTH * LCD_HEIGHT * 2) / 6), LV_DISPLAY_RENDER_MODE_PARTIAL);

  //encoderDev = lv_indev_create();
  //lv_indev_set_type(encoderDev, LV_INDEV_TYPE_ENCODER);
  //lv_indev_set_read_cb(encoderDev, myEncoderRead);

  //ui_init();
  // Create a simple label
  //lv_obj_t *label = lv_label_create(lv_scr_act());
  //lv_label_set_text(label, "Hello LVGL!");
  //lv_obj_align(label, LV_ALIGN_CENTER, 0, 0);

  img_bg_img.header.magic = LV_IMAGE_HEADER_MAGIC;
  img_bg_img.header.cf = LV_COLOR_FORMAT_ARGB8888;
  img_bg_img.header.flags = 0;
  img_bg_img.header.w = 240;
  img_bg_img.header.h = 240;
  img_bg_img.header.stride = 960;
  img_bg_img.data_size = sizeof(img_bg_img_map);
  img_bg_img.data = img_bg_img_map;

  // backgroundImg
  lv_obj_t *bgobj = lv_image_create(lv_scr_act());
  lv_obj_set_pos(bgobj, 0, 0);
  lv_obj_set_size(bgobj, LV_SIZE_CONTENT, LV_SIZE_CONTENT);
  lv_image_set_src(bgobj, &img_bg_img);

  img_compass_main.header.magic = LV_IMAGE_HEADER_MAGIC;
  img_compass_main.header.cf = LV_COLOR_FORMAT_ARGB8888;
  img_compass_main.header.flags = 0;
  img_compass_main.header.w = 180;
  img_compass_main.header.h = 180;
  img_compass_main.header.stride = 720;
  img_compass_main.data_size = sizeof(img_compass_main_map);
  img_compass_main.data = img_compass_main_map;

  // compassMain
  lv_obj_t *compassobj = lv_image_create(lv_scr_act());
  lv_obj_set_pos(compassobj, 30, 30);
  lv_obj_set_size(compassobj, LV_SIZE_CONTENT, LV_SIZE_CONTENT);
  lv_image_set_src(compassobj, &img_compass_main);
  lv_obj_set_style_transform_rotation(compassobj, 0, LV_PART_MAIN | LV_STATE_DEFAULT);
  lv_obj_set_style_transform_pivot_x(compassobj, 90, LV_PART_MAIN | LV_STATE_DEFAULT);
  lv_obj_set_style_transform_pivot_y(compassobj, 90, LV_PART_MAIN | LV_STATE_DEFAULT);
}

TaskHandle_t mainTask;

void processPeripheral(void *pvParameters) {
  while (1) {
    rotaryEncoderLoop();
    vTaskDelay(10);
  }
}

void setup() {
  Serial.begin(115200);
  Serial.println("Hello, ESP32-S3!");
  preferences.begin("m5dial0", false);
  //load key-values here
  preferences.end();

  peripheralSetup();
  lcdSetup();

  xTaskCreate(processPeripheral, "Task 0", 1024, NULL, 1, &mainTask);

  delay(100);
}

//loop mapped to idle task, keeping lcd refresh here for now
void loop() {
  lv_timer_handler(); // Call LVGL task handler
  //ui_tick();
  Serial.println("Hello, ESP32-S3!");
  //rotaryEncoderLoop();
  vTaskDelay(10);
}